import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import { ContextProvider } from "./context/Context";
import {SMContextProvider} from "./SMContext/SMContext"
ReactDOM.render(
  <React.StrictMode>
    <ContextProvider>
      <SMContextProvider></SMContextProvider>
      <App />

    </ContextProvider>
  </React.StrictMode>,
  document.getElementById("root")
);
